  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:22.076702\",\n\t\"name\": \"rainwater-basin-wetland-management-district-annual-narrative-report-2001\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rainwater
  Basin WMD outlines accomplishments during the 2001 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses compliance with
  environmental and cultural resource mandates and research and investigations. Administration
  is outlined; information about personnel, youth programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, grasslands, grazing, haying, fire management,
  pest control, wilderness areas, and WPA easements. The wildlife section of the report
  discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
  and disease control. The public uses of the District described in this report include
  interpretive programs, hunting, and law enforcement. The equipment and facilities
  section of the report provides information about major maintenance, communication
  systems, and computer systems.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
